Nematodes are the most diverse group among invertebrates that inhabit the forest soil and litter and also have high densities. They occupy important positions in soil food chains feeding the primary decomposers (bacteria and fungi) and being consumers (plant feeders, predators and omnivores) [

, 

, 

, 

].Any change in the habitat that influences their food source or environment will be reflected in species diversity [

].

The first investigations into the soil nematodes of Moldovan forests started in the Codrii Forest Reserve in the 1960s [

] and the most detailed research has been done after 1990 [

, 

, 

, 

].

The nematodes from various type of deciduous forests, such as oak (
Quercus petraea , Q. robur
), beech (
Fagus sylvatica
with
Quercus spp .
), lime-ash (
Tilia tomentosa , T. cordata, Fraxinus excelsior
), oak-hornbeam (
Quercus petraea, Carpinus betulus
), maple-hornbeam (
Acer campester , A. platanoides, Carpinus betulus
) and mixed forests, have been studied for more than ten years. This paper is based on all the existed data on soil nematodes found in the deciduous forests of Moldova.

Samples were collected from litter and from the 0-15 cm layer of soil in five replications during more than ten years. Nematodes were extracted by sieving and decanting standard methods of brass screens and Baermann funnels and fixed in a hot 4% formaldehyde solution. The nematode specimens were identified on mass-slides to species [

, 

, 

, 

]. To determine the trophic groups the outline for soil ecologists of Yeates, G.W.et al. [

] has been used.
